import React from "react";
import loginImg from "./../../assets/image/download.jpeg";
import {
  auth,
  createuser as createUserProfileDocument,
} from "./../../firebase/firebase.utils";
import { Button } from "react-bootstrap";
export class Register extends React.Component {
  constructor() {
    super();

    this.state = {
      displayName: "",
      email: "",
      password: "",
    };
  }

  handleSubmit = async (event) => {
    event.preventDefault();

    const { displayName, email, password } = this.state;

    try {
      const { user } = await auth.createUserWithEmailAndPassword(
        email,
        password
      );

      await createUserProfileDocument(user, { displayName });

      this.setState({
        displayName: "",
        email: "",
        password: "",
      });
    } catch (error) {
      console.error(error);
    }
  };

  handleChange = (event) => {
    const { name, value } = event.target;

    this.setState({ [name]: value });
  };

  render() {
    const { displayName, email, password } = this.state;
    return (
        <div className="base-container" ref={this.props.containerRef}>
        <div className="header">
           Register
        </div>
       <div className="content">
           <div className="image">
               <img src={loginImg} /> 
           </div>
           <div className="form">
           <div className="form-group">
                   <label htmlFor="username">Username</label>
                   <input type="text" name="username"
              value={displayName}
              onChange={this.handleChange} placeholder="Username" />
               </div>
               <div className="form-group">
                   <label htmlFor="email">email</label>
                   <input type="email" name="email" value={email}
              onChange={this.handleChange} placeholder="email" />
               </div>
               <div className="form-group">
                   <label htmlFor="password">Password</label>
                   <input type="password" name="password" 
                   
              value={password}
              onChange={this.handleChange}
              placeholder="password" />
               </div>
           </div> 
       </div>
       <div className="footer">
           <button className="btn" type="button">Regsiter</button>
       </div>
    </div>       
    );
  }
}

const FormInput = ({ handleChange, label, ...otherProps }) => (
  <div className="form-group">
       <label htmlFor="username">Username</label>
    <input className="form-input" onChange={handleChange} {...otherProps} />
  </div>
);
